import test1213asdasd from "./image/cuoi5.jpg";
import kaka123 from "./image/kaka123.png";
function App() {
  return (
    <div
      className="h-[1000px] bg-cover "
      style={{ backgroundImage: `url(${kaka123})` }}
    >
      <h1 className="text-white text-4xl font-bold text-center pt-20">
        Hello, React with Tailwind!
      </h1>
    </div>
  );
}

export default App;
